          <Link to="/share" style={{color: "white"}} ><h4 className="navItem">Share</h4></Link>
          <Link to="/inbox" style={{color: "white"}}><h4 className="navItem">Inbox</h4></Link>
          </div>
          {/* </div> */}
        </nav>
      )
